('1512','6','7386','Villa Nagel',Null,'Mediterrane Villa direkt am Golfplatz von Santa Ponsa','14291','Diese fantastische Villa im Cortijo-Stil befindet sich in der sehr beliebten Golfplatzanlage Las Abubillas. Die Villa hat eine Wohnfläche von 220 m² und steht auf einem Grundstück von 850 m² in einem sehr liebevoll angelegten mediterranen Garten. Im Erdgeschoss befindet sich das großzügige Wohn-Esszimmer mit Kamin, die voll ausgestatte Küche, ein Gäste-WC sowie das Gästeschlafzimmer mit  Bad en suite und direktem Zugang zur Terrasse, Schwimmbad und Patio. Im Obergeschoss befindet sich  das Hauptschlafzimmer mit Ankleide und Badezimmer en suite, und ein weiteres Schlafzimmer mit Bad en suite. Die Villa befindet sich in einem erstklassigen Zustand und verfügt über verschiedene Terrassen, Schwimmbad im liebevoll angelegten Patio,  sowie einen extra BBQ-Bereich. Weitere Extras: Doppelglasfenster, Klima w/k, Fußbodenheizung, Wasserfilter mit Trinkwasserqualität, separate Waschküche, Fitnessraum, automatische Bewässerung, Bodega, Garage sowie PKW-Stellplatz.','14292','975000','111','2010-11-08 11:55:30','110','2010-11-08 12:05:18','1511','864','121','438',1,'1','0',Null,Null,Null,'14293',Null,'0','0','0',Null,'2016-03-23 14:23:31',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'14294',Null,'14295',Null,'14296',Null,'14297','Hausmeister José Luis de la Cruz 607.686.818','14298','0',0,'0');
